import { useEffect } from "react";
import { Route, Routes } from "react-router-dom";
import Home from "./Home";

const RouteSetting = () => {
  useEffect(() => {
    document.title = "BISWAJIT PRADHAN";
  }, []);
  return (
    <>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </>
  );
};
export default RouteSetting;
